css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("whitehouse.gov") {

/*text&background*/

html, body, tbody, thead, th, tr, td, blockquote, p, form, div#healthcare-header-container, div.topnav-dd-inner, ul#topnav li div.topnav-dd-outer, ul#topnav div.topnav-feature, div#page, #sub-footer, #right-rail, .extend-page-full, #browse-photo-list, #browse-video-list, #browse-podacst-list, #media-browse-subhdr, #media-browse-subhdr span.category, #media-browse-subhdr span.category-plain, #browse-photo-list li.item a:hover, .briefing-room .item-list ul.pager li.active a, #page .item-list ul.pager li.pager-current, .extend-page, #blog .sub-links, #home-detail, #home-edge-under-blue, #home-a-new-foundation, #home-two-column-detail, .divide-fade, #content .section-intro h2.title, #home-detail h2, #content .extra-info-sm, #content ul.entry-list .date-line

{
color: white !important;
background: black !important;
}

select, button, div#footer, div#subhead-wrapper, div#wh-splash-wrapper, div.wh-splash-hidden, div#splash-main-letter, div#stay-connected-tout

{
background: black !important;
}

div, span

{
background-color: black !important;
}

select, input, span, code, textarea, pre, label, div, dd

{
color: white !important;
}

/*links*/

a

{
color: #0040ff !important;
}

a:visited

{
color: #224375 !important;
}

/*highlight*/

textarea, pre, input, code

{
background: #333333 !important;
}

div#stay-connected-tout

{
border: 4px solid black !important;
}

}
